import React, { Component } from 'react';

class CalcBtn extends React.Component{
    render(){
        const styles = {
            backgroundColor:this.props.color
        }
        return(
            <div className="btn" style={styles}>
               {this.props.value}
            </div>
        )

    }

}
export default CalcBtn;
